import React from 'react'
import './AboutMe.css';
const AboutMe = () => {
    return (
        <section className="about-me-container" id="about">
            <div className="about-me-wrapper">
                <div className="about-me-info">
                    <h1 className="info-title">About Me</h1>
                    <p className="info-text">My name is Tobias Reigenborn and I am a 21 years old web developer from La Plata, Argentina. I am currently a computer science student at the University of La Plata</p>
                </div>
                <div className="about-me-img-container"><img src="./images/foto-perfil-cuadrada.jpg" alt="nemo pic" className="about-me-img" /></div>
            </div>
            
        </section>
    )
}

export default AboutMe;
